window.bookSummaryJSON = "<p>King Arthur in outer space?</p> <p>Endless warfare has ravaged Earth, and billions are desperate to escape. One of them is Taylan Ellis.</p> <p>Driven from her home in the West Britannic Isles by an invasion and severed from her children, Taylan enlists with the Britannic Alliance, hoping she can help regain her homeland and find her kids.</p> <p>But decades of internal conflict and terrestrial and space warfare have left the BA on the edge of collapse.</p> <p>Then its battleship, the Valiant, picks up a distress signal. The rescuers break into a sealed chamber and find the apparently mummified remains of an Iron Age chieftain. Disappointed, they're about to leave when they discover the \"mummy\" has a pulse.</p> <p>Taylan suspects she knows who the mystery man is and what he’s capable of. If she’s right, can she convince her superiors and save the BA, her country, and her children?</p> <p><i>The Valiant</i> is Book One in J.J. Green’s new space fantasy series, Star Legend.</p>"; 
